 con chip M2 cùng 10 nhân GPU - Chạy tốt các tác vụ như render video, chỉnh sửa hình ảnh',15000000,14000000,12,'https://cdn2.cellphones.com.vn/358x358,webp,q100/media/catalog/product/m/2/m2_256gb.png','Mac Mini M2 2023 – Kích thước nhỏ gọn, hiệu năng nổi trội\nMac Mini M2 là sản phẩm được đánh giá cao từ tính năng đến thiết kế, nhà sản xuất đã cải tiến để đáp ứng các nhu cầu khác nhau của khách hàng so với bản tiền nhiệm trước đó. Sản phẩm đã được mong đợi từ trước khi ra mắt với số lượng đặt trước tăng lên liên tục khi được chính thức tung ra thị trường.\nHiệu năng nổi trội\nVới dung lượng bộ nhớ lên đến 8GB 256GB, người dùng thỏa sức tải game nặng ký, các tài liệu về máy chủ mà vẫn còn chỗ trống. Trang bị con chipset mạnh mẽ Apple M2 với 8 nhân CPU, 10 nhân GPU, 16 nhân Neural Engine cùng băng thông bộ nhớ 100GB/s và tạo độ mượt mà nhanh nhạy khi thực hiện các tác vụ',1,0,5,'2023-07-31 00:00:00','2023-07-31 00:00:00');


--
-- Table structure for table `feedback`
