CREATE TABLE `feedback` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(100) CHARACTER SET utf8mb3 NOT NULL,
  `email` varchar(100) NOT NULL,
  `subject` varchar(200) CHARACTER SET utf8mb3  NOT NULL,
  `message` varchar(500) CHARACTER SET utf8mb3  NOT NULL,
  `created_at` datetime DEFAULT NULL,
  `status` int DEFAULT '0' COMMENT '0: chưa xử lý, 1: đã xử lý',
  `user_id` int NOT NULL,
  PRIMARY KEY (`id`),
  KEY `u_id` (`user_id`),
  CONSTRAINT `u_id` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4;


